def load_image(filename, width, height):
    with open(filename, newline='') as csvfile:
        data = list(csv.reader(csvfile,  delimiter=';'))
    arr = np.array(data)
    arr = arr.astype(np.uint16)
    arr[0, :] = (((arr[0, :]-np.amin(arr).astype(float))) /
                 (np.amax(arr)-np.amin(arr))*255).astype(np.uint8)
    arr = arr.reshape((height, width))
    arr_larger = np.zeros((height, width, 3), dtype=np.uint8)
    for i in range(height):
        for j in range(width):
            arr_larger[i][j][0] = arr[i][j]
            arr_larger[i][j][1] = arr[i][j]
            arr_larger[i][j][2] = arr[i][j]
    return arr_larger


